(3662,	1,	'2018-01-11 12:14:25',	'2018-01-11 12:14:25',	'The campaign will formally be inaugurated with several prominent guest will be invited at the event. At the inauguration official 25 years logo will be launched and a dedicated website for the campaign will be unveild. The event will have mutliple islamic lectures on SEERAH\r\n\r\n<img class=\"wp-image-4312 size-large aligncenter\" src=\"http://www.ima25years.org/wp-content/uploads/2018/01/Final-Kickoff-Printable--731x1024.jpg\" alt=\"\" width=\"731\" height=\"1024\" />',	'Campaign Kickoff Event',	'',	'publish',	'closed',	'closed',	'',	'web-design-meetup',	'',	'',	'2018-09-03 13:23:53',	'2018-09-03 13:23:53',	'',	0,	'http://demo.leafcolor.com/conferencepro/?post_type=tribe_events&#038;p=3662',	0,	'tribe_events',	'',	0),
(3690,	1,	'2018-01-11 17:14:05',	'2018-01-11 10:14:05',	'Fahad is the co-founder and lead trainer at Falaq. With over 13 years experience in business development, a passion for enriching and adding value to lives of people around him\r\n\r\nFahad is primarily responsible for crafting Falaq\'s vision and designing Falaq’s training and consultancy programs. With more than 2,400 individuals who have benefited from his training and seminars just over the past 2 years\r\n\r\nFahad is an inspirational life coach known for his flagship \'Discover Your Vision\' workshop and ‘Time Hack’ seminar.',	'Janab Abdul Aziz',	'',	'publish',	'closed',	'closed',	'',	'mr-fahad-sarwani',	'',	'',	'2018-10-17 09:49:29',	'2018-10-17 09:49:29',	'',	0,	'http://demo.leafcolor.com/conferencepro/?post_type=sp_member&#038;p=3690',	0,	'sp_member',	'',	0),
