(4130,	1,	'2018-08-29 19:37:19',	'2018-08-29 19:37:19',	'<h1><span style=\"color: #ff0000;\">Please note that below <strong>Sports days</strong> is <strong>cancelled</strong> due to extreme weather conditions.</span></h1>\r\nA full day Sports events will be organized for youths and children.\r\n\r\n<strong>Click here to register - <a href=\"https://goo.gl/forms/z3tfI0V0GnqMMYTi1\">https://goo.gl/forms/z3tfI0V0GnqMMYTi1</a></strong>\r\n<div><strong><span style=\"color: #ff0000;\">LIST OF GAMES AND ATHLETICS</span></strong></div>\r\n<ul>\r\n 	<li dir=\"auto\">Tug of War</li>\r\n 	<li dir=\"auto\">Shot Put</li>\r\n 	<li dir=\"auto\">Relay Races</li>\r\n 	<li dir=\"auto\">Running Races</li>\r\n 	<li dir=\"auto\">Discus Throw</li>\r\n 	<li dir=\"auto\">Long Jump</li>\r\n 	<li dir=\"auto\">Javelin Throw</li>\r\n</ul>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\"><span style=\"color: #ff0000;\">Location :KEIFAN STADIUM ( <a href=\"https://goo.gl/maps/oDimM66gLFQ2\" target=\"_blank\" rel=\"noopener noreferrer\" data-auth=\"NotApplicable\">https://goo.gl/maps/oDimM66gLFQ2</a>) BLOCK -1</span></div>\r\n<div dir=\"auto\">Date :November 16th 2018</div>\r\n<div>TIMINGS :7AM TO 4PM.</div>\r\n<div></div>\r\n<div dir=\"auto\">Contact details : 94125097,97883564,66152119.</div>\r\n<div dir=\"auto\"></div>\r\n<div dir=\"auto\"></div>\r\n<h1 dir=\"auto\" style=\"text-align: center;\">RULES AND REGULATIONS</h1>\r\n<div dir=\"auto\">\r\n\r\n<strong><u>RULES FOR LONG JUMP :-</u></strong>\r\n<ul>\r\n 	<li>This is a single or individual game.</li>\r\n 	<li>Participant must be an <strong>Indian national</strong> and physically fit for this Jump.</li>\r\n 	<li>All individual safety equipment’s such as shoes, elbow pad and Knee pad will not be provided by management.</li>\r\n 	<li>It’s an open event with age bar of <strong>less than 40 years</strong>.</li>\r\n 	<li>Top 8 long Jumper among all participants will qualify for best of 3 Long Jump.</li>\r\n 	<li>Once competition has begun, athletes are not permitted to use the competition runway for practice purposes</li>\r\n 	<li>No part of the athlete\'s foot should cross the front edge of the foul line. If, at the point of take-off, any part of his foot (even the toe edge of his shoe) crosses the front edge of the foul line, then the jump is termed to be illegal or a \'foul jump\', and does not count.</li>\r\n 	<li>The distance or the \'jump\' is measured from the front edge of the foul line to the first landing point of the athlete.</li>\r\n 	<li><strong>Somersaults</strong> are not permitted during the jump.</li>\r\n</ul>\r\n<strong><u>Rules &amp; Regulations For KABADDI</u></strong>\r\n<ul>\r\n 	<li>Each team shall consist of no more than 10 players with only 7 taking to the field at any one time.</li>\r\n 	<li>There are 4 officials looking after each Kabaddi match. The officials comprise of a 2 referee, and the 2 scorer.</li>\r\n 	<li>The duration of the match is two halves of 20 minutes with a half time break of 5 minutes.</li>\r\n 	<li>At the start of a Kabaddi match, there is a coin toss with the winner having the choice as to whether to have the first raid or not. In the second half of the match, the team that did not raid first shall begin the second half with a raid.</li>\r\n 	<li>To win a point when raiding, the raider must take a breath and run into the opposition’s half and tag one or more members of the opposing team and then return to their own half of the pitch before inhaling again.</li>\r\n 	<li>To prove that another breath hasn’t been taken, the rider must continue to repeatedly yell the word ‘Kabaddi’. Failure to do this, even for just a moment means that the rider must return to their own side of the court without points and the opposite team is awarded a point for a successful defense play.</li>\r\n 	<li>The team being raided is defending, and the players must prevent the raiders from tagging them and returning back over the halfway line. Whilst in defence, a team may score a point by successfully preventing the raider returning to their own half after tagging them. Raiders may only be grabbed by their limbs or torso, not by their hair, clothes or anywhere else, and defenders are not permitted to cross the centre line.</li>\r\n 	<li>Each team will take turns in raiding and defending. Following halftime, the two teams switch sides of the court and the team who defended first in the first half begin the second half by raiding.</li>\r\n 	<li>The game continues in this way until the time is up, the team with the most points at the end of the match is declared the winner</li>\r\n</ul>\r\n<strong><u>Rules &amp; Regulations </u></strong>\r\n<ul>\r\n 	<li>Each team shall consist of no more than 10 players with only 7 taking to the field at any one time.</li>\r\n 	<li>There are 4 officials looking after each Kabaddi match. The officials comprise of a 2 referee, and the 2 scorer.</li>\r\n 	<li>The duration of the match is two halves of 20 minutes with a half time break of 5 minutes.</li>\r\n 	<li>At the start of a Kabaddi match, there is a coin toss with the winner having the choice as to whether to have the first raid or not. In the second half of the match, the team that did not raid first shall begin the second half with a raid.</li>\r\n 	<li>To win a point when raiding, the raider must take a breath and run into the opposition’s half and tag one or more members of the opposing team and then return to their own half of the pitch before inhaling again.</li>\r\n 	<li>To prove that another breath hasn’t been taken, the rider must continue to repeatedly yell the word ‘Kabaddi’. Failure to do this, even for just a moment means that the rider must return to their own side of the court without points and the opposite team is awarded a point for a successful defense play.</li>\r\n 	<li>The team being raided is defending, and the players must prevent the raiders from tagging them and returning back over the halfway line. Whilst in defence, a team may score a point by successfully preventing the raider returning to their own half after tagging them. Raiders may only be grabbed by their limbs or torso, not by their hair, clothes or anywhere else, and defenders are not permitted to cross the centre line.</li>\r\n 	<li>Each team will take turns in raiding and defending. Following halftime, the two teams switch sides of the court and the team who defended first in the first half begin the second half by raiding.</li>\r\n 	<li>The game continues in this way until the time is up, the team with the most points at the end of the match is declared the winner</li>\r\n</ul>\r\n<strong><u>RULES &amp; Regulations for TUG OF WAR </u></strong>\r\n<ul>\r\n 	<li>Each team can accommodate a maximum of <strong>8 Members</strong>. However the combined weight of these members should not exceed the weight determined for the particular category.</li>\r\n 	<li>Registration of Teams to be done online (<strong>For Indian Nationals Only</strong>).</li>\r\n 	<li>Each Player needs to mention their exact weight and combined weight should fall into below mentioned categories.</li>\r\n</ul>\r\n<strong>Combined Weight Categories:</strong>\r\n\r\n560 KGS (65 to 70 Kilograms each Team Member)\r\n\r\n650 KGS (75 to 80 Kilograms each Team Member)\r\n\r\n700 KGS (80 t0 90 Kilograms each Team Member)\r\n<ul>\r\n 	<li>Each category of above will have a Winner &amp; Runner up.</li>\r\n 	<li>Matches are best of three pull, the winner winning two out of the three pulls.</li>\r\n</ul>\r\n<strong><u>RULES &amp; Regulations for Sprint Race :-</u></strong>\r\n<ul>\r\n 	<li>3 Sprint races (100m,400m, 800m) and one Relay race (4 x 100m) will be organized</li>\r\n 	<li>The age limit for participation in the events is _ and above</li>\r\n 	<li>Every participant (or team) is required to register via the link prior to the event.</li>\r\n 	<li>Participants must be of Indian nationality and must carry their Civil ID’s</li>\r\n 	<li>Each round of race will include 8 runners or 8 teams at a time</li>\r\n 	<li>All running events will be run in counter-clockwise direction</li>\r\n 	<li>Runners are permitted only one false start. Second false start will lead to disqualification.</li>\r\n 	<li>All runners must remain in their respective lanes throughout the race</li>\r\n 	<li>The baton can only be passed within the exchange zone, which is 20 meters long.</li>\r\n 	<li>Exchanges made outside the zone will result in disqualification</li>\r\n 	<li>The baton must be carried by hand. If it is dropped, the runner can leave the lane to retrieve the baton</li>\r\n 	<li>Runners may not wear gloves or place substances on their hands to obtain a better grip on the baton</li>\r\n 	<li>The race ends when a runner’s torso (not the head, arms, or legs) crosses the finish line</li>\r\n 	<li>Participants who are unwilling to abide by the race rules will be disqualified.</li>\r\n 	<li>Participants shall behave politely toward all race staff and abide by their guidance and instructions.</li>\r\n</ul>\r\n<strong><u>RULES &amp; Regulations for Shot Put :-</u></strong>\r\n<ol>\r\n 	<li>Players must be <strong>Indian National </strong>and age must be between 20-40 years</li>\r\n 	<li>Shot put ball weight will be 5kg (11.02 lb)</li>\r\n 	<li>Every participant will get only one round, among them top 8 participants will get 3 rounds in next set.</li>\r\n</ol>\r\n<strong><u>RULES &amp; Regulations for Discuss Throw :-</u></strong>\r\n<ol>\r\n 	<li>The discus can only be thrown by an athlete when he or she will stand inside a circle which has a diameter of 2.5m.</li>\r\n 	<li>During the course of throw, the athletes are prohibited from touching the top of the rim. However, they can touch the inner part of the rim.</li>\r\n 	<li>An athlete cannot touch the ground beyond the circle.</li>\r\n 	<li>If the athlete leaves the circle before the landing of the disc on the ground, then it will be considered as a foul throw.</li>\r\n 	<li>There is particular boundary of landing of the disc. If the disc lands outside that zone, then that throw is considered invalid.</li>\r\n</ol>\r\n</div>\r\n<div dir=\"auto\">\r\n\r\n<strong>Javelin Throw – Rules</strong>\r\n1.Holding the javelin must be done at the grip part and should always be maintained\r\nabove the shoulder level.\r\n2. For valid throw, the javelin must lie before the specified zone and its tip should hit\r\nthe ground.\r\n3. There is a special marking line on the runway within which the athlete needs to\r\nthrow.\r\n4. The athlete should not leave the ground until the javelin lands on the ground.\r\n5.After the throwing action has been made, the thrower should not turn back towards\r\nthe pointing direction, until it lands.\r\n6.The number of throws allowed per athlete is same as that of the discus throw.\r\n7. Once the competition has started, the athletes cannot use the perimeter for practice\r\npurpose.\r\n8.Using any device that may assist the thrower in throwing is strictly prohibited. For\r\nexample, tapping of fingers are not allowed unless there is a wound.\r\n9.The throw will be considered as a foul in the following cases −\r\nImproper throw of the javelin in the attempt.\r\nDemarking of the line with any body part.\r\n10.Player going out of the marking line while throwing\r\n11.The tip of the javelin lies outside the edges of the landing sector.\r\n12. The time is increased to 1 minute if there are 2-3 number of competitors. In case\r\nonly one competitor is left, time is increased to 2 minutes.\r\n\r\nNOTE:\r\nParticipant must be an Indian National\r\nAll Participants must carry their valid Civil ID\r\nOnline Registration is must\r\n\r\n</div>',	'YouthWing Sports Day - Cancelled',	'',	'draft',	'closed',	'closed',	'',	'sports-event',	'',	'',	'2018-11-16 13:33:05',	'2018-11-16 13:33:05',	'',	0,	'http://www.ima25years.org/?post_type=tribe_events&#038;p=4130',	0,	'tribe_events',	'',	0),
