(4136,	1,	'2018-08-29 19:41:47',	'2018-08-29 19:41:47',	'<span style=\"font-weight: 400;\">A full day Childrens program will be organised to encourage and motivate children for islamic knowledge and inculcate islamic manners. Several events such as Hifz competition, SEERAH Speeches, Islamic quiz etc. will be conducted and prizes will be distributed.</span>\r\n<h2 style=\"text-align: center;\"><a href=\"https://goo.gl/forms/gN4q6Rgr3bxLRD0k2\"><strong>REGISTER</strong></a></h2>\r\n<iframe src=\"https://docs.google.com/forms/d/e/1FAIpQLScuRymkdyt4K1V2kyGRUBFZeFRW3yPNfBkKUgeP__8giF28bQ/viewform?embedded=true\" width=\"800\" height=\"1488\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\">Loading...</iframe>\r\n<h1>Terms and conditions</h1>\r\n<h1>Pre- Event</h1>\r\n<h2>Photography Competition <em>(In charge: Br. Rizwan Danish - 99632314)</em></h2>\r\n<ul>\r\n 	<li>Only pictures snap in Kuwait are qualified to enter the competition</li>\r\n 	<li>Indian children living in Kuwait between the age of 5 to 15 years can participate with the maximum of 5 photos per person</li>\r\n 	<li>photos from any and all types of cameras including smartphones are accepted</li>\r\n 	<li>Submit the original high resolution photos by email to <a href=\"mailto:photo@IMAkuwait.org\">photo@imakuwait.org</a> no later than 24th October 2018</li>\r\n</ul>\r\n<h2>Essay Competition <em>(In charge: Br. Jawwad - 97663708)</em></h2>\r\n<ul>\r\n 	<li>Indians living in Kuwait</li>\r\n 	<li>Group 1: Age 6 - 11</li>\r\n 	<li>Group 2: Age 12 - 15</li>\r\n 	<li>Topic - Prophet Muhammed (Sallallahu Alaihi Wa Sallam) The Messenger of Peace</li>\r\n 	<li>Should not exceed 1000 words</li>\r\n 	<li>Essay should be comprising of authentic events from Seerah</li>\r\n 	<li>Self-written</li>\r\n 	<li>If Hadith are mentioned : References should be mentioned</li>\r\n 	<li>To be sent on<a href=\"mailto:imachildrencircle@gmail.com\"> imachildrencircle@gmail.com</a>   not later than 24th October 2018</li>\r\n 	<li>Mention the following in subject of an email while sending  (<strong style=\"font-size: 1rem;\">Name - age group - essay competition)</strong></li>\r\n</ul>\r\n<h1>Event Day</h1>\r\n<h2>Drawing Competition <em>(In charge: Br. Rizwan Danish - 99632314)</em></h2>\r\n<ul>\r\n 	<li>Three Categories</li>\r\n 	<li>Age group 5 to 8 years (Theme: Nature)</li>\r\n 	<li>Age group 9 to 11 years (Theme: Kuwait Landscape)</li>\r\n 	<li>Age group 12 to 15 years (Theme: How the world would be after 50 years from now)</li>\r\n 	<li>Drawing should be done at the venue.</li>\r\n 	<li>Charts will be provide at the venue</li>\r\n 	<li>Participants should bring their own colors pencils/ crayons / sketches/ paints etc.</li>\r\n 	<li>Duration 1 hour</li>\r\n</ul>\r\n<h2>Nasheed Competition <em>(In charge: Br. Jawwad - 97663708)</em></h2>\r\n<ul>\r\n 	<li>Indians living in Kuwait</li>\r\n 	<li>Group 1- Age 5 - 10</li>\r\n 	<li>Group 2 - Age 11 - 15 (separate for boys and girls)</li>\r\n 	<li>Nasheed on Seerah (Naat)</li>\r\n 	<li>Language - Urdu, Hindi or English</li>\r\n 	<li>There should not be any shirkiya stanzas in the Nasheed</li>\r\n</ul>\r\n<h2>Qirat Competition <em>(In charge: Br. Imran Rizwi - 94423179)</em></h2>\r\nLevel 1: Non-Hafiz -Academic Students\r\n<ul>\r\n 	<li>Age 5 years and below: Surah Fateha (Surah No :01) or Surah Al Kawthar (Surah no :108)</li>\r\n 	<li>Age 6 years to 10: Surah Al Layl (Surah No 92) or Surah Al Balad (Surah No 90)</li>\r\n 	<li>Age 11 years to 15: Surah Al Qalam (Surah No 68) or Surah Taqhaboon (Surah no 64)</li>\r\n</ul>\r\n(Separate for boys and girls)\r\n\r\nLevel 2:  Hafiz-Madrasa Students\r\n<ul>\r\n 	<li>Group 1: upto 1st ten Juz</li>\r\n 	<li>Group 2: upto 2nd ten Juz</li>\r\n 	<li>Group 3: Complete Quran</li>\r\n</ul>\r\nParticipants are not allowed more than one level and group.\r\n\r\nParticipants will be judged on memorization and recitation according to rule of Tajweed.\r\n<h2>Azaan competition <em>(In charge: Br. Imran Rizwi - 94423179)</em></h2>\r\n<ul>\r\n 	<li>Age Group 5 and below</li>\r\n 	<li>Age Group 6 to 10</li>\r\n 	<li>Age Group 11 to 15</li>\r\n 	<li>Participants are not allowed more than one group</li>\r\n</ul>\r\n(For Boys Only)\r\n<h3>Quiz Competition <em>(In charge: Br. Shoeb / Br. Abdul Quddus-99263974 / 51685889)</em></h3>\r\n<ul>\r\n 	<li>Each team can comprise of a maximum of 3 members. Age group (8 to 15 Years)</li>\r\n 	<li>Participants are required to provide their valid age proof document.</li>\r\n 	<li>There will be on the spot registrations leading up to the event.</li>\r\n</ul>\r\nTopics Covered\r\n<ul>\r\n 	<li>Science Inventions &amp; Inventors</li>\r\n 	<li>Sports ( Cricket , Foot Ball &amp; Athlete )</li>\r\n 	<li>History India &amp; Basic Kuwait</li>\r\n 	<li>Geography International locations &amp; places</li>\r\n 	<li>For AUDIO Rounds ( Audio speeches of famous personalities )</li>\r\n 	<li>For Visual Rounds ( Visual Images of famous location in India and Kuwait)</li>\r\n</ul>\r\n<h3>Group Act: <em>(Incharge: Br. Yusuf Chorghey - 66613162)</em></h3>\r\n<ul>\r\n 	<li>Group Act with moral message; social sensitive topics ( race, religion, politics etc should be avoided)</li>\r\n 	<li>Group A: Age 9 -12 Years</li>\r\n 	<li>Group B: Age 12 -15 Years</li>\r\n 	<li>Language English or Hindi</li>\r\n 	<li>Duration: 5 minutes (Additional 2 minutes will be given for any stage settings)</li>\r\n 	<li>Mike requirement if any should be informed prior to the program to the stage manager</li>\r\n 	<li>Maximum number of members in the group act will be 6.</li>\r\n 	<li>Registration should be in advanced. Last date 24th October 2018</li>\r\n</ul>\r\n<h3>Role play <em>(In charge: Br. Noman - 55132227)</em></h3>\r\n<ul>\r\n 	<li>Group A- 6 to 10 years</li>\r\n 	<li>Group B- 11 to 15 years</li>\r\n 	<li>Participant to pick a chit on the spot and perform the Role for 2 minutes</li>\r\n 	<li>At the time of registration on the venue Participant will pick the chit and he will get 10 to 15 min. to understand and be prepared for performance.</li>\r\n</ul>',	'IMA Children Fest 2018',	'A full day childrens program will be organised to encourage and motivate children for islamic knowledge and inculcate islamic manners. Several events such as Hifz competition, SEERAH Speaches, Islamic quiz etc. will be conducted and prizes will be distributed.',	'publish',	'open',	'closed',	'',	'childrens-event',	'',	'',	'2018-11-04 11:27:57',	'2018-11-04 11:27:57',	'',	0,	'http://www.ima25years.org/?post_type=tribe_events&#038;p=4136',	-1,	'tribe_events',	'',	0),
