(4156,	1,	'2018-08-29 19:49:57',	'2018-08-29 19:49:57',	'[vc_row][vc_column][vc_column_text]\r\n<h2><strong>A momentous campaign to mark 25 years of glorious service to community</strong></h2>\r\n<span style=\"font-weight: 400;\">Indian Muslim Association, popularly known as IMA was established in the year 1992 after the liberation of Kuwait. IMA had a very humble beginning with few members and activities largely confined to areas like Salmiya &amp; Fahaheel. Since its inception IMA has been primarily striving to inculcate &amp; refine moral values amongst the Indian expatriates living in Kuwait. IMA also works for the social upliftment of needy in Kuwait as well as back in India, our motherland. Another prime objective of IMA is to promote goodwill and friendship among different communities living in Kuwait. </span>\r\n<blockquote><strong>Despite its humble beginning, IMA has had an extraordinary journey. With a  few members and confined areas of activities at the beginning, it has now hundreds of members and activities spread across Kuwait. It has had the privilege to host internationally acclaimed scholars and orators such as Nouman Ali Khan, Maulana Ejaz Aslam, Ibrahim Hooper, Yvonne Ridley, Fahad Sarwani.  It also hosted major programs on addressing social issues such as Islam is Green where hundreds of trees had been planted across Kuwait.</strong></blockquote>\r\n<span style=\"font-weight: 400;\">IMA organized  number of interfaith programs. Indian Ambassadors to Kuwait &amp; other officials from the Indian Embassy in Kuwait have time and again graced its programs.</span>\r\n<h3><strong>IMA will launch a momentous campaign in September that will comprise of various social, cultural, educational &amp; religious events, and will culminate with a Grand Convention on the 30th of November. </strong></h3>\r\n[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][sc_post_timeline post_type=\"tribe_events\" cat=\"timeline\" count=\"20\" order=\"ASC\" event_display=\"custom\" startdate=\"year\"][/vc_column][/vc_row]',	'The Campaign',	'',	'publish',	'closed',	'closed',	'',	'the-campaign',	'',	'',	'2018-11-16 11:46:09',	'2018-11-16 11:46:09',	'',	0,	'http://www.ima25years.org/?page_id=4156',	0,	'page',	'',	0),
(4157,	1,	'2018-08-29 19:49:57',	'2018-08-29 19:49:57',	'<h1><span style=\"font-weight: 400;\">About IMA</span></h1>\r\n<span style=\"font-weight: 400;\">Indian Muslim Association (IMA) is one of the oldest associations in Kuwait strives for promoting Islamic awareness among Indian Muslim expatriates through educational, cultural events and social activities. IMA also promotes goodwill, friendship among Non-Muslims and cultural groups particularly among Indian expatriates.</span>\r\n\r\n<span style=\"font-weight: 400;\">IMA conducts its various social, cultural, educational and religious activities within the parameters of regulations of Kuwait and in coordination with Ministry of Awqaf &amp; Islamic Affairs. IMA is also a registered association with Indian Embassy in Kuwait.</span>\r\n\r\n<span style=\"font-weight: 400;\">For carrying out our activities smoothly, IMA has formed 6 regional Units in Kuwait City, Salmiya, Abbasiya, Khaitan, Fahaheel and Abu Halifa. IMA has its Youth Wing as well as Ladies Wing to pursue its activities among various segments of Indian Community.</span>\r\n\r\n<span style=\"font-weight: 400;\">IMA believes in Unity of Mankind and shall contribute for universal brotherhood, peace, tolerance, co-existence and communal amity. To attain this purpose IMA conducts programs and activities such as Get-Togethers, lectures, seminars, workshops, sports activities, educational &amp; cultural picnics etc. Some of the highlights of IMA activities are as follows.</span>\r\n<h2><strong>VISION AND MISSION</strong></h2>\r\n<ul>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Participating &amp; supporting for Educational upliftment and social welfare activities.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Providing assistance to the victims of natural and other calamities such as flood, earthquakes, riots etc irrespective of their cast and creed</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Promoting religious awareness among the Indian Muslim community. For this purpose, weekly Quran &amp; Hadith Classes are arranged in various places around Kuwait.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Friday Sermons are also arranged in some of the Masajids in coordination with Ministry of Awqaf &amp; Islamic Affairs.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">IMA also conducts ‘Eid Get together’ where community leaders and Members of various religious and social backgrounds are invited.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">IMA organizes events like yearly Family Picnic for providing entertainment for the entire family with educational interludes.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Promote the comparative study of different religions and build communal harmony.</span></h4>\r\n</li>\r\n 	<li>\r\n<h4><span style=\"font-weight: 400;\">Promote a friendly environment among the different fellow citizens of Indian continent to eradicate the misconceptions about Islam and Muslims.</span></h4>\r\n</li>\r\n</ul>',	'About IMA',	'',	'publish',	'closed',	'closed',	'',	'about-ima',	'',	'',	'2018-09-04 07:47:12',	'2018-09-04 07:47:12',	'',	0,	'http://www.ima25years.org/?page_id=4157',	0,	'page',	'',	0),
(4158,	1,	'2018-08-29 19:49:57',	'2018-08-29 19:49:57',	'<h2><b>IMA Youth Wing</b></h2>\r\n<span style=\"font-weight: 400;\">IMA YouthWing is a youth and students organization which aims at developing the </span>\r\n\r\n<span style=\"font-weight: 400;\">personality of youth</span>\r\n<h2><b>IMA Ladies Wing</b></h2>\r\n<span style=\"font-weight: 400;\">IMA Ladies Wing works towards educating Muslim women on spiritual and personal level .</span>\r\n\r\n<span style=\"font-weight: 400;\">It works towards development of beautiful character in ladies which would benefit the </span>\r\n\r\n<span style=\"font-weight: 400;\">entire family and the generations to come.</span>\r\n<h2><b>CHILDREN CIRCLE</b></h2>\r\n<span style=\"font-weight: 400;\"> The objective of Children Circle is  to equip the growing children with the most </span>\r\n\r\n<span style=\"font-weight: 400;\">excellent Islamic as well as worldly abilities so that they may grow with </span>\r\n\r\n<span style=\"font-weight: 400;\">clarity and competence in the modern world.</span>\r\n<h2><b>Karnataka Muslim Welfare Association (KMWA)</b></h2>\r\n<span style=\"font-weight: 400;\">A subsidiary of IMA, KMWA conducts various activities and programs in Kuwait mainly among the people of Karnataka residing in Kuwait.</span>\r\n<h2><b>Andhra Pradesh Muslim Association (APMA)</b></h2>\r\n<span style=\"font-weight: 400;\">A subsidiary of IMA, APWA conducts various activities and programs in Kuwait focused at the people of  Andhra residing in Kuwait.</span>\r\n<h2><b>Tamil Muslim Association (TMC)</b></h2>\r\n<span style=\"font-weight: 400;\">A subsidiary of IMA, TMC conducts various activities and programs in Kuwait focused at the people of  Tamilnadu residing in Kuwait.</span>',	'SUBSIDIARIES',	'',	'publish',	'closed',	'closed',	'',	'subsidiaries',	'',	'',	'2018-09-02 18:36:39',	'2018-09-02 18:36:39',	'',	0,	'http://www.ima25years.org/?page_id=4158',	0,	'page',	'',	0),
