(4315,	1,	'2018-09-04 05:24:25',	'2018-09-04 05:24:25',	'[vc_row][vc_column][vc_column_text]\r\n<h4>Despite its humble beginning, IMA has had an extraordinary journey. With a  few members and confined areas of activities at the beginning, it has now hundreds of members and activities spread across Kuwait, Below is a list of milestones in the history of IMA</h4>\r\n[/vc_column_text][sc_post_timeline cat=\"imamilestone\" count=\"20\" order=\"ASC\" event_display=\"custom\" startdate=\"year\" enddate=\"year\"][/vc_column][/vc_row]',	'IMA Milestone',	'',	'publish',	'closed',	'closed',	'',	'ima-milestone',	'',	'',	'2018-09-04 06:01:38',	'2018-09-04 06:01:38',	'',	0,	'http://www.ima25years.org/?page_id=4315',	0,	'page',	'',	0),
(4328,	1,	'2009-09-04 05:35:04',	'2009-09-04 05:35:04',	'<div id=\"body-wrap\">\r\n<div id=\"wrap\">\r\n<div id=\"body\">\r\n<div class=\"container\">\r\n<div class=\"content-pad-4x\">\r\n<div class=\"row\">\r\n<div id=\"content\" class=\" col-md-9 \" role=\"main\">\r\n<div class=\"single-page-content\">\r\n\r\nIMA Ladies Wing strives to empower the Muslim women by educating them towards their spiritual and personal development. It instils values that assist women to fulfil their duties towards their family and the entire community, thereby, building an ideal character which would benefit generations to come.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',	'LadiesWing formed',	'',	'publish',	'open',	'open',	'',	'ladieswing-formed',	'',	'',	'2018-10-03 20:08:34',	'2018-10-03 20:08:34',	'',	0,	'http://www.ima25years.org/?p=4328',	0,	'post',	'',	0),
(4331,	1,	'2006-01-04 05:37:40',	'2006-01-04 05:37:40',	'<div id=\"body-wrap\">\r\n<div id=\"wrap\">\r\n<div id=\"body\">\r\n<div class=\"container\">\r\n<div class=\"content-pad-4x\">\r\n<div class=\"row\">\r\n<div id=\"content\" class=\" col-md-9 \" role=\"main\">\r\n<div class=\"single-page-content\">\r\n\r\nIMA YouthWing is a youth and students organization which aims at developing the personality of youth\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',	'YouthWing Formed',	'',	'publish',	'open',	'open',	'',	'youthwing-formed',	'',	'',	'2018-09-09 13:11:54',	'2018-09-09 13:11:54',	'',	0,	'http://www.ima25years.org/?p=4331',	0,	'post',	'',	0),
(4333,	1,	'2017-09-04 05:38:15',	'2017-09-04 05:38:15',	'<div id=\"body-wrap\">\r\n<div id=\"wrap\">\r\n<div id=\"body\">\r\n<div class=\"container\">\r\n<div class=\"content-pad-4x\">\r\n<div class=\"row\">\r\n<div id=\"content\" class=\" col-md-9 \" role=\"main\">\r\n<div class=\"single-page-content\">\r\n\r\nThe Children’s Circle aims to equip the budding children with Islamic knowledge and worldly skills required to make the future generation a complete human being. It organizes programs to keep the young ones mentally and physically fit and helps them excel in their academics through team building and creative problem-solving techniques. This circle conducts various events for fostering moral and ethical values , compassion towards one another and respect for the elders.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',	'Children Circle formed',	'',	'publish',	'open',	'open',	'',	'children-circle-formed',	'',	'',	'2018-10-03 20:09:04',	'2018-10-03 20:09:04',	'',	0,	'http://www.ima25years.org/?p=4333',	0,	'post',	'',	0),
