(4337,	1,	'1992-09-04 05:41:34',	'1992-09-04 05:41:34',	'<div id=\"body-wrap\">\r\n<div id=\"wrap\">\r\n<div id=\"body\">\r\n<div class=\"container\">\r\n<div class=\"content-pad-4x\">\r\n<div class=\"row\">\r\n<div id=\"content\" class=\" col-md-9 \" role=\"main\">\r\n<div class=\"single-page-content\">\r\n\r\nIndian Muslim Association, popularly known as IMA was established in the year 1992 after the liberation of Kuwait\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',	'IMA was established',	'',	'publish',	'open',	'open',	'',	'ima-was-established-in-the-year-1992-after-the-liberation-of-kuwait',	'',	'',	'2018-09-04 08:09:49',	'2018-09-04 08:09:49',	'',	0,	'http://www.ima25years.org/?p=4337',	0,	'post',	'',	0),
