(4365,	1,	'2010-04-23 06:12:19',	'2010-04-23 06:12:19',	'IMA Youth Wing organized a grand Youth Conference at Masjid Al Kabeer to conclude the 3-months campaign on the Quranic theme - <strong><em>Minaz Zulumati Ilan Noor</em> (from Darkness to Light).</strong>\r\n\r\nProminent Kuwaiti scholar Sheikh Abdul Hameed Jasim Al-Bilali, President of Bashair Al-Khair Committee, addressed the massive gathering at Masjid Al-Kabeer and set the conference activities in motion which included painting, designing, photography, essay writing competitions and various sports. Kuwaiti dignitaries like Waleed Al-Shuaib, Under-Secretary of department of Mosques, Ministry of Awqaf &amp; Islamic Affairs,  Yusuf Al-Shuaib, Manager- Communities, Ministry of Awqaf &amp; Islamic Affairs, Ahmed Abdullatif Al-Asfoor, Manager –Masjid Al-Kabeer, Abdul Hameed Al-Bilali, Chairman – Jamiya Bashayer Al-Khair, Khalid Bader- Manager, Jamiya Abdullah Al-Noori, Khalid Al-Saba – Manager, Communities department IPC and Shaikh Ahmed Al-Dabbous – Prominent Scholar, graced the dais and individually appreciated the outstanding work of IMA Youth Wing. Several eminent scholars from India namely - Shaikh Jalaluddin Ansar Umri, Ameenul Hasan, Malik Motasim Khan, Abdul Aziz addressed the audience.  Shri Vinod Kumar, First Secretary, Information &amp; Education, Indian Embassy was the guest of honor and lauded the worthwhile efforts of the IMA Youths.',	'From Darkness to Light- An historic conference',	'',	'publish',	'open',	'open',	'',	'historic-conference-from-darkness-to-light',	'',	'',	'2018-10-03 19:53:08',	'2018-10-03 19:53:08',	'',	0,	'http://www.ima25years.org/?p=4365',	0,	'post',	'',	0),
