(4441,	1,	'2018-09-14 10:30:04',	'2018-09-14 10:30:04',	'Indian Muslim Association (IMA) recently arranged a spectacular kick off session of its commemoration of 25 year to its services in Kuwait at Grand Mosque of Kuwait . Following Kick of Program IMA will conduct various social, cultural, educational and religious events till November 2018. 25 years commemoration Campaign will culminate with a Grand Convention on the 30th of November at Grand Mosque of Kuwait where may dignitaries are expected to grace the occasion.\r\n\r\nDr Abullah Sulaiman Al Ateequi  of Jamiyatul Islah Kuwait and Mohammad Ali from Grand Mosque graced the occasion and commended the efforts of Indian Community in Kuwait to promote goodness.\r\n\r\nAddressing the kick off program which was also coincided with Islamic New Year Abdul Aziz a visiting scholar from India said that migration of prophet Mohammad pbuh , which is considered as the base event to establish an Islamic Calendar has many relevant lessons in it . Adaptability to the change, Strategies for the betterment, social stability are some of the prime lessons to be learned from the migration he said\r\n\r\nAnother visiting scholar Moulana Mohammad Ilyas Falahi speaking at the event said that Islamic Calendar highlights the importance of time management, planning and organized work.\r\n\r\nA website particularly to promote ’25<sup> </sup>years commemoration campaign of IMA’ which can be visited at <a href=\"http://www.ima25years.org/\" target=\"_blank\" rel=\"noopener\" data-saferedirecturl=\"https://www.google.com/url?q=http://www.ima25years.org&amp;source=gmail&amp;ust=1537452460640000&amp;usg=AFQjCNFNoK70snxOzB1JPviP7RCCT24ZIg\">http://www.ima25years.org</a> was inaugurated by well-known businessman in Kuwait Muzammil Malik.\r\n\r\nSharafuddin Soofi, gave a PowerPoint presentation highlighting the services of IMA in last 25years and also briefed about varied activities planned until November to mark 25 years of services including details about planned mega conference on November 30 at Grand Mosque of Kuwait .\r\n\r\nIMA President Masood Shahab welcomed the audience with his inaugural speech with started with Quran recitation by Master Abdurrahman. Somvail Falahi conducted the program in which approximately 1500 people participated with family.',	'IMA 25 year commemoration campaign kicks off',	'',	'publish',	'open',	'closed',	'',	'ima-25-year-commemoration-campaign-kicks-off',	'',	'',	'2018-09-19 14:12:12',	'2018-09-19 14:12:12',	'',	0,	'http://www.ima25years.org/?post_type=tribe_events&#038;p=4441',	0,	'tribe_events',	'',	0),
