(4609,	1,	'2010-10-03 19:53:54',	'2010-10-03 19:53:54',	'IMA Youth Wing, in coordination with Masjid Al-Kabir, hosted an Iftar Program that was witnessed by a huge gathering, with renowned scholars from both Kuwait and India present at the occasion. The key note speech was delivered by Sheikh Inamullah Islahi and Muhammad Ali, Public Relation Officer of communities’ section at Masjid Al-Kabir, also spoke at the occasion. Other prominent scholars present delivered speeches as well and the program was concluded with the Dua of Sheikh Taher Madani. This event marked the culmination of ‘Quran for all’ Campaign that was carried out by IMA Youth Wing under the patronage of Ministry of Awkaf and in coordination with Masjid Kabir, from the first day of Ramadan till the 10th. The campaign was executed in various parts of Kuwait simultaneously and conveyed that the importance of Quran was not just to read it, but to read it with complete understanding and to make it an essential part of our daily lives through practice.',	'Quran for all campaign',	'',	'publish',	'open',	'open',	'',	'quran-for-all-campaign',	'',	'',	'2018-10-03 19:55:54',	'2018-10-03 19:55:54',	'',	0,	'http://www.ima25years.org/?p=4609',	0,	'post',	'',	0),
