(4612,	1,	'2012-10-03 19:56:36',	'2012-10-03 19:56:36',	'IMA Youth Wing answered the question “why is there no peace &amp; tranquility in our hearts?” in the form of a campaign.\r\n\r\nThe campaign covered several reasons for our prayers being ineffective, which were explained to the masses by means of video clips enacted by Youth Wing members. Audio and Video CDs, books, posters and flyers related to the campaign were distributed in over 30 Masjids across Kuwait. Sermons based on the topic were also delivered on Fridays and before iftar gatherings. This campaign became a key milestone in the growth of Youth Wing and the development of its members.',	'Why are our prayers ineffective Campaign',	'',	'publish',	'open',	'open',	'',	'why-are-our-prayers-ineffective-campaign',	'',	'',	'2018-10-03 19:58:03',	'2018-10-03 19:58:03',	'',	0,	'http://www.ima25years.org/?p=4612',	0,	'post',	'',	0),
(4613,	1,	'2018-10-03 19:57:56',	'2018-10-03 19:57:56',	' ',	'Why are our prayers ineffective Campaign',	'',	'inherit',	'open',	'closed',	'',	'why-are-our-prayers-ineffective-campaign',	'',	'',	'2018-10-03 19:57:56',	'2018-10-03 19:57:56',	'',	4612,	'http://www.ima25years.org/wp-content/uploads/2018/10/Why-are-our-prayers-ineffective-Campaign.jpg',	0,	'attachment',	'image/jpeg',	0),
(4615,	1,	'2014-10-03 19:59:32',	'2014-10-03 19:59:32',	'“Youth for a Better Tomorrow”, was an ardent effort by IMA Youth Wing to organize a fun filled Cultural Event to deliver the message of bringing up responsible youth and to impart the prominence of imbibing high morals, best manners and ethics to them.\r\n\r\nThe event gave the youth a platform to showcase and cultivate their talent in an Islamic way and featured wonderful dramas, soulful nasheeds and classical daff performance by enthusiastic youngsters that left the audience enthralled and craving for more. Talented youngsters also exhibited their skills and talents in the thought provoking dramas satirizing current social evils prevalent in Indian society. The first drama, enacted on Indian political system, had masterstroke urging the audience to support honest and God-fearing politicians who adhere to moral values and to be with a value based political party that can bring about a change in our society. The other drama highlighted marital problems faced by poor and middle-class brides &amp; their parents by presenting the evils of seeking dowry. Mr. Ashfaq Ahmed Shareef, National President – Students Islamic Organization of India (SIO), who was the guest of honor, praised the efforts put in by IMA Youth Wing in honing these talents of the Youth for good cause.',	'YOUTH FOR A BETTER TOMMORROW',	'',	'publish',	'open',	'open',	'',	'youth-for-a-better-tommorrow',	'',	'',	'2018-10-03 19:59:45',	'2018-10-03 19:59:45',	'',	0,	'http://www.ima25years.org/?p=4615',	0,	'post',	'',	0),
(4616,	1,	'2018-10-03 19:59:24',	'2018-10-03 19:59:24',	' ',	'Youth_wing_30',	'',	'inherit',	'open',	'closed',	'',	'youth_wing_30',	'',	'',	'2018-10-03 19:59:24',	'2018-10-03 19:59:24',	'',	4615,	'http://www.ima25years.org/wp-content/uploads/2018/10/Youth_wing_30.jpg',	0,	'attachment',	'image/jpeg',	0),
(4618,	1,	'2016-05-03 20:00:48',	'2016-05-03 20:00:48',	'IMA Youth Wing, in cooperation with Grand Mosque, Ministry of Awqaf &amp; Islamic Affairs, Kuwait, organized a youth convention – “Hayya Alal Falah” ‘Rush to Success’, at Fahaheel, Khaitan and Salmiya zones respectively.\r\n\r\nThe convention witnessed an attendance exceeding one thousand Youths collectively. Mr. Iqbal Hussain, National President SIO of India along with Layeek Ahmed Khan, PR secretary SIO graced the occasion as the Chief Guest and applauded the initiative taken by IMA Youth Wing. This convention  focused on the untapped youth who, without proper guidance, were being influenced by the evils of the society. IMA Youth Wing urged them to associate themselves with Islamic organizations and work towards an ideal society. The youth were reminded of their responsibilities towards the community and their role in shaping its future and emphasized that true success could only be attained by following the Quran and footsteps of Prophet Mohammed (SAWS). The convention proved to be successful with thousands associating themselves with IMA Youth Wing and hundreds becoming close associates. , who would be gradually trained to become members of the Youth Wing and carry its torch forward in the future.',	'HAYYA ALAL FALAH',	'',	'publish',	'open',	'open',	'',	'hayya-alal-falah',	'',	'',	'2018-10-03 20:02:48',	'2018-10-03 20:02:48',	'',	0,	'http://www.ima25years.org/?p=4618',	0,	'post',	'',	0),
