(4624,	1,	'2015-03-03 20:06:22',	'2015-03-03 20:06:22',	'IMA job cell was formed with a vision of helping our members and associates grow in their professional careers by directing them to better opportunities in the market. With the help of its members, IMA keeps vigil on the latest job vacancies and keeps the job seekers well informed of the same. It posts opportunities on the IMA portal and Whatsapp, collects and maintains a huge database of CV’s and forwards the relevant ones to the HR’s of the concerned companies and thus far has helped thousands of candidates successfully land their dream jobs. The job cell also conducts public programs like “Bridging the gap” &amp; “Career opportunities and Guidance” to provide career counselling to students, help freshers write better CV, prepare them for interview and guide professionals on how to rise up in their career paths.',	'IMA Job Cell formed',	'',	'publish',	'open',	'open',	'',	'job-cell',	'',	'',	'2018-10-03 20:07:33',	'2018-10-03 20:07:33',	'',	0,	'http://www.ima25years.org/?p=4624',	0,	'post',	'',	0),
