(4723,	1,	'2018-11-06 04:45:20',	'2018-11-06 04:45:20',	'As part of commemoration of 25 years of religious &amp; Social services in Kuwait, Indian Muslim Association organized an \"Alami Mushaera\"- (a literary and poetic exposition), at \"Al-Islah Centre Auditorium \"on Thursday 18th October 2018.\r\n\r\nFamous and Well-known poets from India took part to present their poetry and literary work. The guests invited were Dr. Tabish Mehdi – a well-known author from Delhi, presided over the Mushaera. Dr. Nawaz Deobandi (recipient of many literary awards and Yesh Bharti award),\r\nDr. Sayed Rashid Hamidi- Islamic scholar &amp; editor of HAYAT e NAU Magazine, Dr. Umair Manzar - writer, Professor of Urdu in MAANU at Lucknow, Dr. Tariq Qamar- Journalist and Senior Editor ETV, Nishtar Amrohi from Delhi, Altaf Zia form Malegaun.\r\n\r\nEjaz Shaheen from Sharjah UAE also attended and presented his poetry.\r\n\r\nLocal poets Amer Qidwai, Kamal Ansari, Naseem Zahid, Badar Seemab, Sayyed Nazar Cadapavi, also recited their poetry . Shamvil Parvez Vice president of IMA also presented his poetry on this occasion.\r\n\r\nMasood Shahab, IMA President and Mohammed Hasan, Chief Organizer of all events conducted in commemoration of IMAs 25years, presented mementos to the Guests.\r\n\r\nUrdu loving gathering listened, enjoyed, appreciated and applauded the guest poets until its conclusion.\r\n\r\nA Food Mela, dishes of Lucknow, Delhi and Hyderabad, was also arranged outside the auditorium.\r\n\r\nThe program started with recitation of verses from The Holy Quran\" by Hafiz Qari Adnan. It was followed by \"Hamd and Naat\" Hymn by Dr. Tabish Mahdi.\r\n\r\nEjaz Shaheen and Dr. Umair Manzar hosted and convened the Mushaera\r\n\r\nNazeer Ahmed, Convener of \"Idara e Adab Kuwait\", a literary wing of IMA, welcomed the guests. The audience listened and applauded the poets until it ended at 1.45am. Mr. Khaled Azmi conveyed”Vote of Thanks\" at the conclusion. Mr. Iqbal Ahmed Abdul Latif and Mr. Khaja Moinudeen were the chief organizers of the event. Mr. Muzammil Malik, Mr. Karm Irfan, pesident of FIMA, and many other dignitaries attended the mushaera.\r\n\r\n[gallery ids=\"4726,4727,4728,4729,4730,4731,4732,4733\"]',	'IMA Kuwait organised Mushaera (Urdu Poetry exposition)',	'',	'publish',	'open',	'open',	'',	'ima-kuwait-organised-mushaera-urdu-poetry-exposition',	'',	'',	'2018-11-06 04:47:39',	'2018-11-06 04:47:39',	'',	0,	'http://www.ima25years.org/?p=4723',	0,	'post',	'',	0),
