(4758,	1,	'2018-11-06 05:47:20',	'2018-11-06 05:47:20',	'Indian Muslim Association (IMA) in coordination with Ministry of Health &amp; Kuwait Blood Bank successfully organized a Blood Donation Camp on 19th October, 2018 at Kuwait Central Bank, Jabriya between 1.00 pm to 5.00pm.\r\n\r\nAs part of commemoration of 25 years of religious &amp; Social services in Kuwait, Indian Muslim Association arranged the event under the auspices of Islam Presentation and Communities Section of Ministry of Awqaf and Islamic Affairs External relations Division.\r\n\r\nA large number of cherished (Gents and Ladies) gathered on the day to donate blood. After filling the appropriate forms with required details, the donors have participated to donate their blood. They also enjoyed the refreshments like juice, biscuits, and dates afterwards. Total Hundred and sixty no. of persons donated their blood.\r\n\r\nIMA General Secretary Mr. Arshad Habib welcomed the distinguished Guest Mr. Yousef Essa Al-Shoyeb and Mr. Mohammed Ali from Communities Section of Ministry of Awqaf and Islamic Affairs External relations Division. They both gave a brief speech encouraging the good social work of IMA.\r\n\r\nOther dignitaries Mr. Kareem Irfan, President FIMA &amp; Mr. Vinod Kumar Grover, former President Indian Doctor’s Forum (IDF) also attended the Camp. Mr. Grover and Mr. Kareem Irfan both praised the Social, Cultural and Islamic activities carried out by IMA and appreciated the donors for their selfless act.\r\n\r\nIMA General Secretary Mr. Arshad Habib presented mementos to the guests and gave them a tour of the entire process of blood donation.\r\n\r\nIMA thanks all the Guests, the Donors and the Volunteers for their presence and co-operation in making the camp a success.<span id=\"ContentPlaceHolder1_lblYRdetails\"></span><span id=\"ContentPlaceHolder1_lblCNTRBdetails\"></span>',	'Indian Muslim Association (IMA) organized Blood Donation Camp',	'',	'publish',	'open',	'open',	'',	'indian-muslim-association-ima-organized-blood-donation-camp',	'',	'',	'2018-11-06 05:47:20',	'2018-11-06 05:47:20',	'',	0,	'http://www.ima25years.org/?p=4758',	0,	'post',	'',	0),
