(4802,	1,	'2018-11-19 11:21:16',	'2018-11-19 11:21:16',	'Indian Muslim Association – Khaitan, Kuwait City and Salmiya units organized a beach-cleaning event on 2nd November 2018 besides Kuwait Tower at 3.30 pm to 5.30 pm. Although the said event was organized by IMA in commemoration with its completion of 25 years in Kuwait however, IMA strongly believes and periodically instigates such events to inspire and empower communities to clean up and conserve the environment. Beach cleaning event is organized with the intention to make sure the beaches are kept pristine; the endeavor aims to stave off pollution caused by waste that could sully the bay &amp; distort the fish habitat.\r\n\r\nThe beach cleaning event was organized in cooperation with Kuwait Dive team that provides full support to the event. The event was even attended by the representatives, Mr. Yousef Eissa Al Shuwaib (Head of community section) from Ministry of Awqaf and Mr. Abdullah Al Hudaib representative from Al Islah community Center.\r\n\r\nThe event commenced with an introductory speech from Mr. Walid Al Shatti from Kuwait Dive Team. He abridged the volunteers on the process of beach cleaning, the kind of precautions needs to be taken and the nature of sewage &amp; wastage to be collected (including bags and cans).\r\n\r\nMr. Al Shuwaib in his introductory lines praised for IMA’s efforts and highlighted the importance of Cleanliness and adherence by all communities in Kuwait to contribute to this Cause to keep Kuwaiti beaches Clean.\r\n\r\nThe acting IMA president, Br Shamvil Parvez, elaborated the importance of Cleanliness in Islam referencing quranic verses and hadith on Purity. Islam has given so much importance to cleanliness as it is considered a part of faith.\r\n\r\nThe campaign witnessed the participation of IMA members, their family’s including women and children and well wishers from the community. Almost 200 volunteers participated in the event.\r\n\r\nPrior to the actual cleaning work, the basic cleaning material were provided to the volunteers such as hand gloves and big plastic bags.\r\n\r\nIMA volunteers took the pleasure in what was set out to do and what they were doing. Within an hour, the garbage bags were filled with sewage and wastages, broken bottles, glass, cigarette butts, sharp metals, paper, remains of foodstuff. At the end the amount\r\n\r\nof garbage retrieved from a relatively small portion of the beach, about 500 m long, was astonishing. After the collection of trash in more than 100 bags, many relaxed and enjoyed at Kuwait tower spot. All volunteers were served with tea and refreshments sponsored from Kuwait Flour Mills. A beautiful memento was presented to the representatives from Kuwait Dive team, Ministry of Awqaf and Jamiah Al islah.\r\n\r\n[gallery ids=\"4735,4737,4736\"]',	'IMA Kuwait Beach Cleaning Drive',	'',	'publish',	'open',	'open',	'',	'ima-kuwait-beach-cleaning-drive',	'',	'',	'2018-11-19 11:25:58',	'2018-11-19 11:25:58',	'',	0,	'http://www.ima25years.org/?p=4802',	0,	'post',	'',	0),
(4814,	1,	'2018-11-19 12:38:06',	'2018-11-19 12:38:06',	'The Indian Muslim Association as part of its 25 years celebration added another feather in its cap by conducting IMA Children Fest 2018. It was conducted in Indian Community School, Amman Branch, Kuwait which was abuzz with the much awaited competitions, held on the 26th of October, 2018. The Children Fest, provided a mammoth platform to the young children aged between 3 years to 15 years to exhibit their talents and build up confidence. The objective of the fest was to beset a wide range of art and Islamic genres including drawing, role play, group act, qirat, azaan, nasheed and general knowledge quiz. Two pre-event competitions were also run; photography reflecting Kuwait heritage while topic for essay writing was Prophet Muhammad (SA) - a messenger of peace. The event coordinator explained that these competitions largely curate artistic talents of the students and bring them closer to their culture. The first edition of Children Fest got off to a colourful start with 32 items comprising nine categories based on age.\r\n\r\nThe competitions commenced at 1:30 pm in all categories with around 500 participants who took part on an average in 3 competitions at least. Cultural Extravaganza was a treat to the eyes. The competitions set the ball rolling for the unwinding of On-stage competition of group act while other competitions were held in different classrooms. The school campus witnessed the spectrum of drama, role play and nasheed. The vibrant children displayed their talents and enjoyed participation more than winning. The off-stage items were organized well for various items including drawing, qirat, azaan to name a few. The participating children exhibited their artistic and creative flair to their best. The artistic, literary and creative skills of the participants enthralled the audience and gave a tough choice for the judges to choose the best ones. One day’s cultural extravaganza gave prospects to the budding participants to display their innate talents. There was a soul to the event. A soul that was vibrant, contagious and exuberant.\r\n\r\nThe Children Fest had a flavor of carnival which kept the visitors engrossed throughout the day with a wide variety of activities like games and competitions, on-the-spot questions, talent shows etc. The ICSK Amman campus was transformed into a fascinating land that charmed all the age-groups. The excitement continued throughout the day as the children as well as parents had varied experience. The on-the-spot questions was the highlight of the evening with more than 100 gifts given away to the excited children and their parents. Mickey Mouse dressed Disney character between the children added excitement and was loved by the toddlers. Apart from the merriment that was visible among the audience in the courtyard, high-spirited crowds thronged the stalls that offered a variety of food items and snacks.\r\n\r\nThe fun filled exciting day culminated with the finale round of quiz with three teams that competed with intensity to be the winner. Audience loved it and cheered the finalists. All children with anticipation waited for the valedictory ceremony where winners were announced and prizes were given. The prize distribution session started with recitation of Quran by Master Abdul Rahman. Mr. Khaled Al Saba, Manager Dawah Section IPC graced the occasion. Mr. Saba in his short talk highlighted that every child who participated is a winner of his challenges and congratulated the winners with his encouraging words. Other guests included, Mr. Mohammed Ali, Coordinator Ministry of Awqaf, Mr. Mohammed Jamal, Community Section Awqaf, Mr. Deep, Community Section Awqaf who marked their presence to bless and congratulate the participants and winners.\r\n\r\nIMA’s core team including Vice president Mr. Shamvil Parvez graced the ceremony. He congratulated the participants and winners and thanked the guests for accepting IMA’s invitation for the event. Mr. Parvez requested parents to encourage their children to participate in such events so that the children have holistic growth. He reiterated that Children Fest 2018 was a part of momentous campaign that started in September comprising of various social, cultural, educational &amp; religious events, and will culminate with a Grand Convention on the 30th of November.\r\n\r\nThe much awaited Prize distribution with more than 140 prizes and certificates were given by the guests. Winners were thrilled when their names were announced. The well-coordinated programme with the efforts of whole IMA team led by the event coordinator, Mr. Ahmed Ali, in charge IMA Children Circle proved to be a grand success.\r\n\r\nMr. Ahmed Ali concluded by informing that IMA shall conduct the event IMA Children Fest every year (God willing) for the benefit of community and aspiring talented children.\r\n\r\n[gallery ids=\"4815,4816,4817,4818,4819,4820,4821,4822,4823\"]',	'IMA Marks History With Its First Children Fest',	'',	'publish',	'open',	'open',	'',	'ima-marks-history-with-its-first-children-fest',	'',	'',	'2018-11-19 12:38:06',	'2018-11-19 12:38:06',	'',	0,	'http://www.ima25years.org/?p=4814',	0,	'post',	'',	0),
